import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <>
        <div style = {{backgroundColor: 'green', height: '100px', width: '100%'}}></div>
        <div style = {{backgroundColor: 'red', height: '100px', width: '100%'}}></div>
        <div style = {{backgroundColor: 'pink', height: '100px', width: '100%'}}></div>
      </>
    );
  }
}

export default App;
